// CSS File
import "./App.css";
// Styled-styledComponents
import Styled from "styled-components";
function App() {
  const DivStyle = Styled.div`
    border: 5px solid black;
    width: 300px;
    height: 300px;
    padding: 5px 10px;
    margin: 20px auto;
  `;
  const Circle = Styled.div`
    background-color: yellow;
    width: 100px;
    height: 100px;
    border-radius: 50%;
  `;
  return (
    <DivStyle>
      <Circle />
      <Circle />
    </DivStyle>
  );
}

export default App;
